import React from "react";
import "./nav.scss";

class Nav extends React.Component {
  render() {
    return (
      <div className="topnav">
        <a className="active" href="/" exact>
          Home
        </a>
        <a href="/todo">Todos</a>
        <a href="/about">About</a>
      </div>
    );
  }
}
export default Nav;
